import React, { Component } from 'react';
import Button from '../button/Button';
import './Card.css';

class Card extends Component {
    constructor(props) {
        super(props);
        this.state = {
            item: props.item
        }
    }
    render() {
        return (
            <div classList="Card card">
                <img src={this.state.item.srx} classList="card-img-top" alt="..."/>
                <div classList="card-body">
                    <h5 classList="card-title">Card title</h5>
                    <p classList="card-text">Some quick example text to build on the card.</p>
                    <Button value={this.state.item.text}/>
                </div>
            </div>
        );
    }
}

export default Card;
